	add("recapitulation", "{\"term\":\"recapitulation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027recapitulaciun\u0027 et al., Middle french (ca. 1400-1600) \u0027recapitulacion\u0027 et al., or their source, from \u0027recapitulatio\u0027 () from the participle stem of \u0027recapitulare\u0027 () from \u0027\u0027 + \u0027capitulum\u0027 () diminutive of \u0027caput\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A subsequent brief recitement or enumeration of the major points in a narrative, article, or book\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The third major section of a musical movement written in sonata form, representing thematic material that originally appeared in the exposition section\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The reenactment of the embryonic development in evolution of the species\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The symmetry provided by Christ\u0027s life to the teachings of the Old Testament; the summation of human experience in Jesus Christ\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 144\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"one would expect God\u0027s final purpose to be expressed in his created world, since the doctrine of \u0027\u0027recapitulation\u0027\u0027 showed that this is where his plans had worked out before\", \"priority\":6}]}, \"synonyms\":{}}");

