	add("receptor", "{\"term\":\"receptor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027receptour\u0027 or Latin Latin|receptor\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A protein on a cell wall that binds with specific molecules so that they can be absorbed into the cell in order to control certain functions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027: In the target organ, the drug is recognised by ‘\u0027\u0027receptors\u0027\u0027’. These are large molecules, usually proteins, to which the drug binds tightly and with a high degree of specificity. — Leslie Iversen, \u0027Drugs: A Very Short Introduction\u0027 (Oxford 2001, p. 24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any specialized cell or structure that responds to sensory stimuli\", \"priority\":3}]}, \"synonyms\":{}}");

