	add("recipe", "{\"term\":\"recipe\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027récipé\u0027 from Latin \u0027recipiō\u0027 (receive) Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A formula for preparing or using a medicine; a prescription; also, a medicine prepared from such instructions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/leaders/21583270-new-zealands-plan-regulate-designer-drugs-better-trying-ban-them-and-failing-new A new passage\u003dAs the world\u0027s drug habit shows, governments are failing in their quest to monitor every London window-box and Andean hillside for banned plants. But even that Sisyphean task looks easy next to the fight against synthetic drugs. No sooner has a drug been blacklisted than chemists adjust their \u0027\u0027recipe\u0027\u0027 and start churning out a subtly different one\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any set of instructions for preparing a mixture of ingredients\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"By extension, a plan or procedure to obtain a given end result\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/books-and-arts/21604535-real-sir-isaac-newton-was-not-first-king-reason-last Magician’s passage\u003d[Isaac Newton] was obsessed with alchemy. He spent hours copying alchemical \u0027\u0027recipes\u0027\u0027 and trying to replicate them in his laboratory. He believed that the Bible contained numerological codes. The truth is that Newton was very much a product of his time\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Now especially, a set of instructions for making or preparing food dishes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A set of conditions and parameters of an industrial process to obtain a given result\", \"priority\":7}]}, \"synonyms\":{}}");

	add("recipient", "{\"term\":\"recipient\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027récipient\u0027 from Latin stem of \u0027recipiens\u0027 present participle of \u0027recipio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who receives, such as one who receives money or goods\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An individual receiving donor organs or tissues\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The portion of an alembic or other still in which the distilled liquid is collected\", \"priority\":3}]}, \"synonyms\":{}}");

	add("reciprocation", "{\"term\":\"reciprocation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|reciprocate|ion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of reciprocating; interchange of acts; a mutual giving and returning; as, the reciprocation of kindness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Alternate recurrence or action; as, the reciprocation of the sea in the flow and ebb of tides; oscillation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1662\u0027\u0027 Thomas Salusbury, \u0027Galileo\u0027s Dialogue Concerning the Two Chief World Systems\u0027, Dialogue 2\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the same pendulum alwayes maketh its \u0027\u0027reciprocations\u0027\u0027 in equall times\", \"priority\":4}]}, \"synonyms\":{}}");

