	add("recitative", "{\"term\":\"recitative\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"From Italian \u0027recitativo\u0027 from \u0027recitare\u0027 from Latin \u0027recito\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"dialogue, in an opera etc, that, rather than being sung as an aria, is reproduced with the rhythms of normal speech, often with simple musical accompaniment or harpsichord continuo, serving to expound the plot\", \"priority\":1}]}, \"synonyms\":{}}");

