	add("reclusiveness", "{\"term\":\"reclusiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of being reclusive\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Erica Wagner, [http://entertainment.timesonline.co.uk/tol/arts_and_entertainment/books/article725321.ece \u0026quot;First word: People don\u0027t love Harper Lee—they love her work\u0026quot;], \u0027Times Online\u0027, London, 4 Feb (retrieved 29 June 2007\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But of Lee you hear hardly anything at all; she is nearly as famous for her \u0027\u0027reclusiveness\u0027\u0027 (now there’s an oxymoron) as J. D. Salinger\", \"priority\":3}]}, \"synonyms\":{}}");

	add("recognition", "{\"term\":\"recognition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027recognitionem\u0027 (accusative of \u0027recognitio\u0027), from stem \u0027recognit\u0027, past participle of \u0027recognoscere\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of recognizing or the condition of being recognize\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He looked at her for ten full minutes before \u0027\u0027recognition\u0027\u0027 dawned\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, w:Charles W. Charles W. Chesnutt, \u0027The House Behind the Cedars\u0027, Chapter I\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Warwick observed, as they passed through the respectable quarter, that few people who met the girl greeted her, and that some others whom she passed at gates or doorways gave her no sign of \u0027\u0027recognition\u0027\u0027; from which he inferred that she was possibly a visitor in the town and not well acquainted\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"an awareness that something observed has been observed befor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"acceptance as valid or tru\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The law was a \u0027\u0027recognition\u0027\u0027 of their civil rights\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"With fresh material, taxonomic conclusions are leavened by \u0027\u0027recognition\u0027\u0027 that the material examined reflects the site it occupied; a herbarium packet gives one only a small fraction of the data desirable for sound conclusions. Herbarium material does not, indeed, allow one to extrapolate safely: what you see is what you ge\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"official acceptance of the status of a new government by that of another countr\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"honour, favourable note, or attentio\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The charity gained plenty of \u0027\u0027recognition\u0027\u0027 for its efforts, but little money\", \"priority\":11}]}, \"synonyms\":{}}");

	add("recognization", "{\"term\":\"recognization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|recognize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process or act of recognizing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("recoil", "{\"term\":\"recoil\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027reculer\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A starting or falling back; a rebound; a shrinking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027recoil\u0027\u0027 of nature, or of the blood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state or condition of having recoiled\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"F. W. Robertso\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027recoil\u0027\u0027 from formalism is skepticism\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The energy transmitted back to the shooter from a firearm which has fired. Recoil is a function of the weight of the weapon, the weight of the projectile, and the speed at which it leaves the muzzle\", \"priority\":6}]}, \"synonyms\":{}}");

