	add("recompense", "{\"term\":\"recompense\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) \u0027recompense\u0027 from \u0027recompenso\u0027 from Latin \u0027re-\u0027 (lang\u003dla) + \u0027compenso\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An equivalent returned for anything given, done, or suffered; compensation; reward; amends; requital\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which compensates for an injury, or other type of harm or damage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He offered money as \u0027\u0027recompense\u0027\u0027 for the damage, but what the injured party wanted as \u0027\u0027recompense\u0027\u0027 was an apology\", \"priority\":3}]}, \"synonyms\":{}}");

	add("recomposer", "{\"term\":\"recomposer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|recompose|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who recomposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, M. Daniel Carroll R., \u0027Amos: The Prophet and His Oracles\u0027 (page 20\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To say the \u0027\u0027recomposers\u0027\u0027 of the book of Amos may not meaningfully do so is to imply that we may not\", \"priority\":3}]}, \"synonyms\":{}}");

	add("recomposition", "{\"term\":\"recomposition\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|re|composition|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Composition again or anew; the process or result of recomposing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("reconcilement", "{\"term\":\"reconcilement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|reconcile|ment|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact of being restored to cordial relations with each other; settling differences, making peace; reconciliation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, \u0027The Faerie Queene\u0027, III.1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thus \u0027\u0027reconcilement\u0027\u0027 was betweene them knitt, Through goodly temperaunce and affection chaste\", \"priority\":3}]}, \"synonyms\":{}}");

	add("reconnaissance", "{\"term\":\"reconnaissance\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027reconnaissance\u0027 (recognition)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of scouting or exploring (especially military or medical) to gain information\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Arthur C. Clarke, \u0027Rendezvous with Rama\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The third member, Sergeant Pieter Rousseau, had been with the back-up teams at the Hub; he was an expert on space \u0027\u0027reconnaissance\u0027\u0027 instrumentation, but on this trip he would have to depend on his own eyes and a small portable telescope\", \"priority\":3}]}, \"synonyms\":{}}");

