	add("reconstructionist", "{\"term\":\"reconstructionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|reconstruction|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who attempts to reestablish an ancient or historic religion in the modern era\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who builds a reconstruction of a scene or event\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Larry S. Nordhoff, \u0027Motor Vehicle Collision Injuries\u0027 (page 34\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"As with biomechanics, the majority of traffic accident \u0027\u0027reconstructionists\u0027\u0027 work primarily for insurance industry\", \"priority\":4}]}, \"synonyms\":{}}");

