	add("recoupment", "{\"term\":\"recoupment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|recoup|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A recovery of what had been lost\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1879\u0027\u0027, John Neilson Taylor, \u0027A Treatise on the American Law of Landlord and Tenant\u0027, page 32\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The doctrine of \u0027\u0027recoupment\u0027\u0027 is of recent growth, hardly preceding in its origin the beginning of the present century\", \"priority\":3}]}, \"synonyms\":{}}");

	add("recourse", "{\"term\":\"recourse\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027recours\u0027 \u0026lt; Latin \u0027recursus\u0027 past participle of \u0027recurrō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of seeking assistance or advice\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sir H. Wotto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thus died this great peer, in a time of great \u0027\u0027recourse\u0027\u0027 unto him and dependence upon him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Our last \u0027\u0027recourse\u0027\u0027 is therefore to our art\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027: , Chapter 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Tarzan would have liked to subdue the ugly beast without \u0027\u0027recourse\u0027\u0027 to knife or arrows. So much had his great strength and agility increased in the period following his maturity that he had come to believe that he might master the redoubtable Terkoz in a hand to hand fight were it not for the terrible advantage the anthropoid\u0027s huge fighting fangs gave him over the poorly armed Tarzan\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, w:M. Barnard M. Barnard Eldershaw, \u0027w:A House is A House Is Built\u0027, chapter VIII, section ii\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Nor were the wool prospects much better. The pastora\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"pastoral industry, which had weathered the severe depression of the early forties by \u0027\u0027recourse\u0027\u0027 to boiling down the sheep for their tallo\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"tallow, and was now firmly re-established as the stapl\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"staple industry of the colony, was threatened once more with eclips\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"eclipse\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A coursing back, or coursing again; renewed course; return; retreat; recurrence\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"swift \u0027\u0027recourse\u0027\u0027 of flushing bloo\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Sir Thomas Brown\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Preventive physic preventeth sickness in the healthy, or the \u0027\u0027recourse\u0027\u0027 thereof in the valetudinary\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Access; admittance\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Give me \u0027\u0027recourse\u0027\u0027 to him\", \"priority\":21}]}, \"synonyms\":{}}");

	add("recovery", "{\"term\":\"recovery\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027recoverie\u0027 from Old french (842-ca. 1400) \u0027recovree\u0027 from \u0027recovrer\u0027 (recover)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of regaining or repossession of something lost\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A return to normal health\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A return to former status or position\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of regaining the natural position after curtseying\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of regaining the position of guard after making an attack, in fencing, sparring, etc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Renewed growth after a slump (economy\", \"priority\":6}]}, \"synonyms\":{}}");

