	add("recreator", "{\"term\":\"recreator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|recreate|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who recreates\", \"priority\":1}]}, \"synonyms\":{}}");

	add("recrimination", "{\"term\":\"recrimination\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027récrimination\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of recriminating\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A counter or mutual accusation\", \"priority\":2}]}, \"synonyms\":{}}");

