	add("recruit", "{\"term\":\"recruit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027recruter\u0027 (as a verb).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supply of anything wasted or exhausted; a reinforcement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person enlisted for service in the army; a newly enlisted soldier\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A hired worke\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"These new \u0027\u0027recruits\u0027\u0027 were hired after passing the interviews\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A new member of a certain population, usually referring to a juvenile\", \"priority\":5}]}, \"synonyms\":{}}");

